/* eslint-disable no-unused-vars */
import React, { lazy, Suspense } from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Switch,
} from "react-router-dom";

const Login = lazy(() => import("./pages/login"));

function App() {
  return (
    <Switch>
      <Route path="/home" component={Login} />
    </Switch>
  );
}

export default App;
